import React from "react";
import {Link,BrowserRouter as Router} from "react-router-dom";
import "./Navigation.css";
function Navbar(){
    return (
        <div className="Navbar" style={{display : "flex", justifyContent:"space-around"}}>
            <li>
                <Router>
                {/* <Link to="/src/Navbar.jsx" className="text-link"><span id="l1">Money </span><span id="l2">Matters</span></Link> */}
                <li><span id="l1">MONEY</span><span id="l2">MATTERS</span></li>
                <li><Link to className="text-link">HOME</Link></li>
                <li><Link to className="text-link">LOGIN</Link></li>
                <li><Link to className="text-link">REGISTER</Link></li>
                <li><Link to className="text-link">ABOUT</Link></li>
                </Router>
            </li>
        </div>
    );
}


export default Navbar;
